import React from 'react';

const Item = (props) => {
  return (
    <div className="item">
      <img 
        src={`/Data/Images/${props.image}`} 
        alt={props["display name"] || "Product"} 
        className="item-image"
      />
      <p className="item-name">{props["display name"]}</p>
      <p className="item-category">{props.category}</p>
      <div className="item-prices">
        <div className="item-price-new">
          {props.type}
        </div>
      </div>
    </div>
  );
};

export default Item;
